import {Grid} from '@material-ui/core';
import randomColor from 'randomcolor';

const RepoPage = () => {
  return (    
    <div className="RepoPage_GridA1">
        
        <Grid container xs={4} spacing={2} direction="column" style={{background:randomColor({hue:'grey'})}}>
          <div>Authorisation</div>
          
          <Grid item xs={16} style={{background:randomColor({hue:'blue'})}}>  
            <div style={{background:randomColor({hue:'green'})}}>Hooray nothing is here!</div>
          </Grid>
          
          <Grid item xs={16}>  
            <div style={{background:randomColor({hue:'green'})}}>Hooray nothing is here!</div>
          </Grid>

          <Grid item xs={16}>  
            <div style={{background:randomColor({hue:'green'})}}>Hooray nothing is here!</div>
          </Grid>
          
          <Grid item xs={16}>  
            <div style={{background:randomColor({hue:'green'})}}>Hooray nothing is here!</div>
          </Grid>

        </Grid>
        
    </div>
  );
};



export default RepoPage;
